import React from "react";

function Navbar() {
  return (
    <div>
      <div class="nav-container" tabindex="0">
        <div class="nav-toggle"></div>

        <nav class="nav-items">
          <a class="nav-item" href="#">
            Яблоко
          </a>
          <a class="nav-item" href="#">
            Вишня
          </a>
          <a class="nav-item" href="#">
            Арбуз
          </a>
        </nav>
      </div>
    </div>
  );
}

export default Navbar;
